description:
Bán nhà đường Nguyễn Bỉnh Khiêm, An Hải Tây, Sơn Trà
- Diện tích đất: 52 m2 (5.3 * 9.8) đường 5.5 m, lề 3 m;
- Kết cấu: nhà 3 tầng, 3 phòng ngủ, 2 wc, kết cấu chắc chắn, thiết kế hiện đại, mới xây còn mới, thoáng mát;
- Vị trí: dân cư đông đúc, kinh doanh sầm uất, tiện ích đầy đủ, gần chợ, công viên Hà Thân, tiện ích đa dạng: khách sạn Mường Thanh, cầu tình yêu, cầu Rồng. Giao thông thuận lợi, kết nối các trục đường Triệu Việt Vương, Ngô Quyền, Nguyễn Thông, Trần Hưng Đạo.

Giá bán: 5 Tỷ
LH: em nhân để xem nhà
